// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;


contract VolcanoCoin {

    uint totalSupply = 10000;
    // Just read a 2016 post stating that unit8 costs more gas than unit256 ...doe this still hold true?

    address owner;
    address constant BURN_ADDR = 0x000000000000000000000000000000000000dEaD;

    modifier onlyOwner {
        if (msg.sender == owner) {
            _;
        }

    }

    constructor() {
        owner = msg.sender;
    }



    function getTotalSupply() public view returns (uint){
        return totalSupply;
    }

    // shouldn't the increment amount be a function param?
    // A function hardcoded to increment by 1000 seems silly
    function incrementTotalSupplyBy(uint mom) public onlyOwner returns (uint _totalSupply) {
        uint currentSupply = totalSupply;
        totalSupply += 1000;
        return currentSupply + 1000;
    }

    function incrementTotalSupplyByThousand(uint amnt) public onlyOwner returns (uint _totalSupply) {
        uint currentSupply = totalSupply;
        totalSupply += 1000;
        return currentSupply + 1000;
    }





    function getAddress() public view returns (address) {
        if (msg.sender == owner) {
            return BURN_ADDR;
        } else {
            return owner;
        }
    }

    function store(uint256 num) public {

    }


}

